import React, { Component } from 'react'
import Navbar from '../components/Navbar'
import Fab from '../components/Fab'
import styled from "styled-components";

export class global extends Component {
  render() {
    return (
      <div>
       <h1>Global</h1>
       <Navbar />
       <Fab />
      </div>
    )
  }
}

export default global
